import React from "react";
import Button from "./Button";

const Input = () => {
  return (
    <form>
      <div>
        <label>Username</label>
        <input type="text"></input>
      </div>
      <div>
        <label>Age (Years)</label>
        <input type="number"></input>
      </div>
      <Button type>Add User</Button>
    </form>
  );
};

export default Input;
